import '../css/styleForCalculator';
import {
    View,
    Text,
    Button
} from 'react-native';
import styleForCalculator from '../css/styleForCalculator';

// import Buttons from '../Buttons/Buttons';

const ButtonsNumeric = (props) => {

    return (
        <View style={styleForCalculator.contButtons}>
            <View style={styleForCalculator.Buttons}><Button onPress={()=>  props.insertNumber('2')} title="2" /></View>
            <View style={styleForCalculator.Buttons}><Button onPress={()=>  props.insertNumber('1')} title="1" /></View>
            <View style={styleForCalculator.Buttons}><Button onPress={()=>  props.insertNumber('3')} title="3" /></View> 
            <View style={styleForCalculator.Buttons}><Button onPress={()=>  props.insertNumber('4')} title="4" /></View> 
            <View style={styleForCalculator.Buttons}><Button onPress={()=>  props.insertNumber('5')} title="5" /></View> 
            <View style={styleForCalculator.Buttons}><Button onPress={()=>  props.insertNumber('6')} title="6" /></View>  
            <View style={styleForCalculator.Buttons}><Button onPress={()=>  props.insertNumber('7')} title="7" /></View> 
            <View style={styleForCalculator.Buttons}><Button onPress={()=>  props.insertNumber('8')} title="8" /></View> 
            <View style={styleForCalculator.Buttons}><Button onPress={()=>  props.insertNumber('9')} title="9" /></View> 
            <View style={styleForCalculator.Buttons}><Button onPress={()=>  props.insertNumber('0')} title="0" /></View>
            <View style={styleForCalculator.Buttons}><Button onPress={()=>  props.insertNumber('.')} title="." /></View> 
            <View style={styleForCalculator.Buttons}><Button onPress={()=>  props.insertNumber('=')} title="=" /></View>        
        </View>
    )
}

export default ButtonsNumeric;
